export default (function(a,b,c,d,e,f,g,h,i,j){return {data:{iMTGxGu6Dq:{data:{id:63,attributes:{imdbId:"tt6316466",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTc5Y2Y1MzgtZmZkMS00Y2QzLTk1MWUtYjAyMTRkZDAwNjJiXkEyXkFqcGdeQXVyMjQ3MTMzNDU@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"3.8\u002F10"},{Source:"Rotten Tomatoes",Value:"74%"},{Source:"Metacritic",Value:"64\u002F100"}],item_lang:{data:{id:726,attributes:{title:c,plot:"Awkward teen Adam spends his last high school summer with his big sister, who throws herself into NYC's lesbian and trans activist scene. In this coming-of-age comedy, Adam and those around him encounter love, friendship and hard truths.",slug:"adam"}}},books:{data:[{id:1998,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:true,published:g,publisher:d,subtitle:h}},{id:1999,attributes:{title:c,description:e,thumbnail:f,authors:[a],firstBook:b,published:g,publisher:d,subtitle:h}},{id:2000,attributes:{title:i,description:"Ariel Schrag, a critically-acclaimed memoirist and screenwriter, takes us on a painfully funny tour of her formative years, from her childhood in Berkeley to her mid-twenties in Brooklyn, exploring what it means to connect to others when you don’t yet know who you are—when you want to be “part of it” but the “it” changes daily. We meet hippie babysitters, mean girls, best friends, former friends, prom dates, girlfriends, sex ed students, and far too many LensCrafters sales associates. These frank, irreverent, and honest comics revel in the uncomfortable—occasionally cringe-inducing—moments from our early years that end up wiring us as people. Part of It further cements Ariel Schrag as “one of the best pure storytellers...in any medium” (Comics Journal).",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1yVDDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2018-11-13",publisher:d,subtitle:j}},{id:2001,attributes:{title:i,description:"From a writer whose confessional style is \"part Robert Crumb and part Judy Blume\"* comes a graphic memoir of growing up that is sometimes shocking, often tender, but more than anything: real. *NPR​",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=V4F0DwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:b,published:"2018-11-01",publisher:"Mariner Books",subtitle:j}},{id:2002,attributes:{title:"Rethinking Normal",description:"A personal account by a college student who endured years of bullying and disapprobation describes how after numerous failed therapies she accepted her transgender status and began learning how to be a girl while pursuing surgical gender reassignment. A first book.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=4ASZBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Katie Rain Hill"],firstBook:b,published:"2014-09-30",publisher:"Simon and Schuster",subtitle:"A Memoir in Transition"}}]}}},meta:{}}},prerenderedAt:1680940906517}}("Ariel Schrag",null,"Adam","Houghton Mifflin Harcourt","During the summer of 2006, California high school student Adam Freedman is sent to stay with his older sister Casey in New York City where she introduces him to a wild, lesbian subculture complete with underground clubs, drinking and a new crowd who assumes he is transgendered. Original. 25,000 first printing.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=2kKfAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2014-01-01","","Part of It","Comics and Confessions"))